import React, { Component } from 'react';

class Footer extends Component {
  render () {
    return (
      <footer className="Footer page-footer">
        <div className="footer-copyright">
          <div className="container">
            Deakin University 2019
          </div>
        </div>
      </footer>
    )
  }
}

export default Footer;
